import React, {useState} from 'react';
import './App.scss';
import './Main.scss';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from '../components/Header/Header';

import Index from './Index/Index';
import About from './About/About';
import Catalog from './Catalog/Catalog';
import Contact from './Contact/Contact';
import Offer from './Offer/Offer';
import Orders from './Orders/Orders';
import ShopService from './ShopService/Services';
import Notfound from './Notfound/Notfound';
import SOffice from './SOffice/SOffice';
import SPaper from './SPaper/SPaper';
import SEnvelopes from './SEnvelopes/SEnvelopes';
import SPackages from './SPackages/SPackages';
import SHygienic from './SHygienic/SHygienic';

function App() {

  const [initSum] = useState({
    total: 112000.00
  });

  const [sOffice] = useState({
    products: [
      {p_id: "6251", p_c_id: "ARTY", p_name: "Cienkopis PILOT V5", p_code: "ARTY6251", p_description: "kolor: czarny", p_price: 5.69},
      {p_id: "2267", p_c_id: "ARTY", p_name: "Długopis TOMA 059/050", p_code: "ARTY2267", p_description: "Kolor niebieski", p_price: 1.21},
      {p_id: "9571", p_c_id: "ARTY", p_name: "Dłukopis zwykły", p_code: "ARTY9571", p_description: "kolor: czarny", p_price: 0.41},
      {p_id: "9571", p_c_id: "ARTY", p_name: "Długopis zwykły", p_code: "ARTY9571", p_description: "kolor: niebieski", p_price: 0.41},
      {p_id: "1940", p_c_id: "ARTY", p_name: "Długopis automatyczny", p_code: "ARTY1940", p_description: "kolor: czerwony", p_price: 0.49},
      {p_id: "1319", p_c_id: "ARTY", p_name: "Flamaster", p_code: "ARTY1319", p_description: "kolor: czarny", p_price: 1.06}
    ]
  });

  sOffice.products.map((sOfficeR, index) => {
    console.log(sOfficeR);
  });
  console.log(sOffice.products[0]);

  return (
    <div className="App">
      <Router>
            <Header totalprice={initSum.total}/>
            <div className="Bodystyle">
              <Switch>
                  <Route exact path="/" component={Index}/>
                  <Route path="/about" component={About}/>
                  <Route path="/catalog" component={Catalog}/>
                  <Route path="/contact" component={Contact}/>
                  <Route path="/offer" component={Offer}/>
                  <Route path="/orders" component={Orders}/>
                  <Route path="/service" component={ShopService}/>
                  <Route path="/soffice" component={SOffice}/>
                  <Route path="/spaper" component={SPaper}/>
                  <Route path="/senvelopes" component={SEnvelopes}/>
                  <Route path="/spackages" component={SPackages}/>
                  <Route path="/shygienic" component={SHygienic}/>
                  <Route component={Notfound}/>
              </Switch>
            </div>
        </Router>
    </div>
  );

}

export default App;
